import React from "react";
import { Link } from "react-router-dom";
import axios from 'axios';
import { render } from "@testing-library/react";
import Navbar from "../components/Navbar1";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import './guideline.css';
import logo from '../icons/Home.png';

class GuidelineStl extends React.Component {
  constructor(props) {
    super(props);
    this.state = { guideline: "" };
  }

  callAPI() {
    fetch("http://localhost:3000/guideline/stl")
      .then(res => res.text())
      .then(res => this.setState({ guideline: res }));
  }

  componentWillMount() {
    this.callAPI();
  }

  render() {

    return (
      <>
        <div>
          <img className="logo" src={logo} alt="Logo" />
        </div>

        <div className="sidebar">
          <Navbar />
        </div>

        <div className="container">
          <div className="address">
            <div style={{ size: '9px' }}>Home > Guidelines > Sign the lease</div>
          </div>
          <div>
            <p>{this.state.guideline}</p>
          </div>
        </div>
      </>

    );
  }
}

export default GuidelineStl;
